      <script>
        // JavaScript for the copy button
        const copyButton = document.getElementById('copy-button');
        const codeBlock = document.querySelector('.pre-code code');
    
        copyButton.addEventListener('click', () => {
            // Create an array to store the lines
            const lines = [];
            
            // Get all the span elements with class "command"
            const commandSpans = codeBlock.querySelectorAll('span.command');
            
            // Iterate through the command spans
            commandSpans.forEach((span) => {
                lines.push(span.textContent.trim()); // Add the trimmed text content to the array
            });
    
            // Combine the lines with line breaks
            const copiedText = lines.join('\n');
    
            // Create a temporary textarea element to copy the code
            const textarea = document.createElement('textarea');
            textarea.value = copiedText;
            document.body.appendChild(textarea);
            textarea.select();
            document.execCommand('copy');
            document.body.removeChild(textarea);
    
            // Change the button text to indicate copying
            copyButton.textContent = 'Copied!';
            setTimeout(() => {
                copyButton.textContent = 'Copy';
            }, 2000); // Reset the button text after 2 seconds
        });
    </script>
